        private Mock<IConsoleService> mockConsole = new Mock<IConsoleService>();

        /// <summary>
        /// Initialize method for this test class.
        /// </summary>
        [TestInitialize]
        public void Init()
        {
            this.serializedRaster = new JsonInput(this.validInput);
            this.deserializedRaster = this.serializedRaster.DeserializeInput<RasterConfig>();

            this.serializedRasterRC = new JsonInput(this.validInputWithReductionConfig);
            this.deserializedRasterRC = this.serializedRasterRC.DeserializeInput<RasterConfig>();

            this.mockConsole.Setup(x => x.PrintError(It.IsAny<string>(), It.IsAny<int>(), It.IsAny<string>(), It.IsAny<string>()))
              .Callback<string, int, string, string>((string msg, int line, string n, string src) => { Console.WriteLine($"ERROR: {msg}"); });
            this.mockConsole.Setup(x => x.PrintDebug(It.IsAny<string>()))
                .Callback<string>((string msg) => { Console.WriteLine($"{msg}"); });
            Prime.Services.ConsoleService = this.mockConsole.Object;
        }

        /// <summary>
        /// Verify that we can make sure a input is verified before it is deserialized.
        /// </summary>
        [TestMethod]
        public void Verify_Input()
        {
            Assert.IsTrue(this.serializedRaster.Validate(this.schema));
        }

        /// <summary>
        /// Verify that we can make sure a input is invalid when it's missing given elements.
        /// </summary>
        public void Verify_MalformedInput()
        {
            var malformedInput = new JsonInput(this.malformedInput);

            Assert.IsFalse(malformedInput.Validate(this.schema));
        }

        /// <summary>
        /// Verify that we can deserialize a given input into an instance of RasterConfig.
        /// </summary>
        [TestMethod]
        public void Deserialize_Input()
        {
            JsonInput serializedRaster = new JsonInput(this.validInput);

            var deserializedRaster = serializedRaster.DeserializeInput<RasterConfig>();

            foreach (var array in deserializedRaster.Setup.LdatArrays.Keys)
            {
                Debug.WriteLine(array);
            }

            Assert.IsInstanceOfType(deserializedRaster, typeof(RasterConfig));
            Assert.IsNotNull(deserializedRaster.Setup);
            Assert.IsNotNull(deserializedRaster.Setup.LdatArrays);
        }

        /// <summary>
        /// Verify that we pass when attempting to check if deserialized config is valid.
        /// </summary>
        [TestMethod]
        public void Verify_DeserializedLdatArrays()
        {
            JsonInput serializedRaster = new JsonInput(this.validInput);

            var deserializedRaster = serializedRaster.DeserializeInput<RasterConfig>();
            Assert.IsTrue(deserializedRaster.Verify());
        }

        /// <summary>
        /// Return the ldat array specified by the string given.
        /// </summary>
        [TestMethod]
        public void GetLdatArray()
        {
            var array = this.deserializedRaster.GetLdatArray("bpu_bme");
            Assert.IsTrue(array.PlistName[0] == "arr_pbist_mclk_x_mcis_core_raster_lsa_bpu_bme_indirect_list"
                && array.PatModConfigSetName == "LSA_RASTER_PAT_MODIFY_SET_CORE");
        }

        /// <summary>
        /// Return the ldat array specified by the string given.
        /// </summary>
        [TestMethod]
        public void GetLdatArray_KeyNotFound()
        {
            var returnValue = this.deserializedRaster.GetLdatArray("fake_array_probably");
            Assert.IsTrue(returnValue == null);
        }

        /// <summary>
        /// This config is a serial raster config, so return false.
        /// </summary>
        [TestMethod]
        public void RasterInParallel_False()
        {
            Assert.IsFalse(this.deserializedRaster.IsRasterInParallel());
        }

        /// <summary>
        /// Returns a ReductionConfigSet for reducing MAF failures.
        /// </summary>
        [TestMethod]
        public void GetReductionConfigSet()
        {
            var reductionConfigSet = this.deserializedRasterRC.GetReductionConfigSet("Example_Set");
            Assert.IsTrue(
                reductionConfigSet.MaxCoresCount == 2
                && reductionConfigSet.ArrayMaxCount == 2
                && reductionConfigSet.ArrayMAFMax == 3);
        }

        /// <summary>
        /// Throws an exception since the config set doesn't exist.
        /// </summary>
        [TestMethod]
        [ExpectedException(typeof(System.Collections.Generic.KeyNotFoundException))]
        public void GetReductionConfigSet_KeyNotFound()
        {
            var reductionConfigSet = this.deserializedRasterRC.GetReductionConfigSet("fake_probably");
            Assert.IsTrue(false, "Expected a KeyNotFoundException, but none were raised.");
        }

