        /// Assert proper PatConfigHandle execution.
        /// </summary>
        [TestMethod]
        public void CreatePatConfigHandles()
        {
            var ldatArray = this.deserializedRasterRC.GetLdatArray("bpu_bme");
            ldatArray.MatchAddressToDwordElement(new Tuple<int, int, int>(0, 0, 0), out var element);
            Mock<IPatConfigService> mockPatConfigService = new Mock<IPatConfigService>();
            mockPatConfigService
                .Setup(x => x.GetPatConfigHandleWithPlist(It.IsAny<string>(), It.IsAny<string>()))
                .Returns(new FakePlistHandle(0));

            Prime.Services.PatConfigService = mockPatConfigService.Object;

            // this is converting out dword elements into patConfig handles.
            // to test this, we need to mock a empty patConfig handle that we can set data to,
            // then iterate over those patConfig handles to see if we set the correct
            // data for each one...
            var handles = ldatArray.CreatePatConfigHandles(element, "Random_Plist");

            foreach (var handle in handles)
            {
                var convertedHandle = handle as FakePlistHandle;
                Assert.IsTrue(convertedHandle.Data == "00000000000000000000000011111111");
            }
        }
    }
}